import React from 'react';
import bear from '../images/bear.png'
import { Link } from 'react-router-dom';
import '../App.css';




function Settings() {
    return(
        <div><div className="Bar" style={{backgroundColor: "#FDB515"}}>
            <img alt="logo" className="photo" src={bear}/>
            <h1 style = {{marginRight: "43%", paddingTop: "10px"}}>StudyBear</h1>
            <h3 className="logInBarText">Setting</h3>
            <h3 className="logInBarText">Profile</h3>
            <h3 className="logInBarText">Matches</h3>
            <Link className="logInBarLink" to= '/logIn'> Signout</Link>
            </div><div className="settingNav" style={{backgroundColor: "#00B0DA"}}>
                <h1 style={{margin: "0px"}}> Navigation</h1>
                <h3>Edit Profile</h3>
                <h3>Change password</h3>
                <h3>Contact Us</h3>
            </div>
        </div>

    );
}

export default Settings;
